import Vue from 'vue';
import Router from 'vue-router';
import Home from '@/views/Home.vue';
import AccountList from '@/components/AccountList.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'Home',
      component: Home
    },
    {
      path: '/accounts',
      name: 'AccountList',
      component: AccountList
    },
    // Ajoutez d'autres routes si nécessaire
  ]
});
